// CardView.js
import React from "react";
import Card from "./Card";
import "./CardView.css";

const extractData = (data) => {
  let count = data.count;
  let extractedData = [];
  for (let i = 0; i < count; i++) {
    extractedData.push({
      id: i + 1,
      volume: data.volume[i],
      Rupee: data.Rupee[i],
    });
  }
  return extractedData;
};

function CardView(props) {
  const card = props.cards.filter((item) => item.id === 2);
  console.log(card);

  const data = [
    { id: 1, volume: 10, Rupee: 5 },
    { id: 2, volume: 20, Rupee: 6 },
    { id: 3, volume: 30, Rupee: 7 },
  ];

  console.log(data);

  return (
    <div className="card-view">
      {data.map((card) => (
        <Card key={card.id} title1={card.title1} title2={card.title2} />
      ))}
    </div>
  );
}

export default CardView;
